import React, { useState } from "react";
import { ContentWrapper, FlexContainer, CustomButton, ContentContainer, HeaderContainer, CenteredForm, FormContainer, Avatar, NavLink, Title, SubTitle, InputContainer } from "../../elements";
import styled from "styled-components";

const LeftAlignedForm = styled("div")`
width: fit-content;
}
`;
const CustomSubTitle = styled(SubTitle)`
width: 500px;
}
`;

const CustomHeaderContainer = styled(HeaderContainer)`
padding-bottom:40px;
}`;

const CustomTitle = styled(Title)`
color: #20AA46;
}`;

const CustomContentContainer = styled(ContentContainer)`
display:flex;
}`;


const End = () => {
    return (
        <>
            <ContentWrapper>
                <LeftAlignedForm>

                    <CustomHeaderContainer>
                        <CustomTitle>Congratulations!</CustomTitle>
                        <CustomSubTitle>Your Information and documents are successfully uploaded, Please wait for approval.</CustomSubTitle>
                    </CustomHeaderContainer>
                    <CustomContentContainer>
                        <CustomButton>Go Home</CustomButton>
                        <CustomButton>Support Center</CustomButton>
                        <CustomButton></CustomButton>
                    </CustomContentContainer>
                </LeftAlignedForm>
            </ContentWrapper>

        </>
    );
};

export default End;
